const initialState = ({
    queries: []
})

export const savedQueries = (state = initialState, action) => {
    switch (action.type) {
        case 'addQuery':
            return {
                ...state,
                queries: state.queries.push(action.name)
            }
        case 'removeQuery':
            const index = state.queries.indexOf(action.name);
            let newQuery = state.queries.splice(index, 1);
            console.log(action.name)
            return {
                ...state,
                queries: newQuery
            }
        default: return state
    }
}
